import React, { Component } from 'react';
import { Card } from 'antd';




class Test extends Component {

    constructor(props){
        super(props);
        this.state = {
            title:'',
            content:''
        }
    }

    render(){
        return (
            <Card title={this.state.title}>
                <p>{this.state.content}</p>

            </Card>
        )
    }
}

export default Test;
